pub enum ErrorKind {
    FlushingBatchFailed,

    /// Attempt to lock the terminal failed.
    AttemptToAcquireLock(String),

    /// Action is not supported by the current backend.
    ActionNotSupported(String),

    /// Atribute is not supported by the current backend.
    AttributeNotSupported(String),

    /// IO error occurred
    IoError(io::Error),

    #[doc(hidden)]
    __Nonexhaustive,
}

pub enum Value {

    /// Get the terminal size.
    TerminalSize,

    /// Get the cursor position.
    CursorPosition,

    /// Try to get an event within the given duration.
    /// The application will wait indefinitely when `None`.
    /// It will wait for some duration if `Some(duration)` is given.
    Event(Option<Duration>),
}

pub enum Retrieved {

    /// The terminal size is returned number of (column, row)s.
    TerminalSize(u16, u16),

    /// The cursor position is returned (column, row).
    /// The top left cell is represented 0,0.
    CursorPosition(u16, u16),

    /// An event is returned.
    /// Timeout occurred if `None` is returned.
    Event(Option<Event>),
}

pub enum Action {

    /// Moves the terminal cursor to the given position (column, row).
    MoveCursorTo(u16, u16),

    /// Hides the terminal cursor.
    HideCursor,

    /// Shows the terminal cursor.
    ShowCursor,

    /// Enables blinking of the terminal cursor.
    EnableBlinking,

    /// Disables blinking of the terminal cursor.
    DisableBlinking,

    /// Clears the terminal screen buffer.
    ClearTerminal(Clear),

    /// Sets the terminal size (columns, rows).
    SetTerminalSize(u16, u16),

    /// Scrolls the terminal screen a given number of rows up.
    ScrollUp(u16),

    /// Scrolls the terminal screen a given number of rows down.
    ScrollDown(u16),

    /// Enables raw mode.
    EnableRawMode,

    /// Disables raw mode.
    DisableRawMode,

    /// Switches to alternate screen.
    EnterAlternateScreen,

    /// Switches back to the main screen.
    LeaveAlternateScreen,

    /// Enables mouse event capturing.
    EnableMouseCapture,

    /// Disables mouse event capturing.
    DisableMouseCapture,

    /// Sets the the foreground color.
    SetForegroundColor(Color),

    /// Sets the the background color.
    SetBackgroundColor(Color),

    /// Sets an attribute.
    SetAttribute(Attribute),

    /// Resets the colors back to default.
    ResetColor,
}

pub enum Event {

    /// A single key event with additional pressed modifiers.
    Key(KeyEvent),

    /// A singe mouse event with additional pressed modifiers.
    Mouse(MouseEvent),

    /// An resize event with new dimensions after resize (columns, rows).
    Resize,

    /// An event was not supported by the backend.
    Unknown,
}

pub enum MouseEvent {

    /// Pressed mouse button.
    ///
    /// Contains mouse button, pressed pointer location (column, row), and additional key modifiers.
    Down(MouseButton, u16, u16, KeyModifiers),

    /// Released mouse button.
    ///
    /// Contains mouse button, released pointer location (column, row), and additional key modifiers.
    Up(MouseButton, u16, u16, KeyModifiers),

    /// Moved mouse pointer while pressing a mouse button.
    ///
    /// Contains the pressed mouse button, released pointer location (column, row), and additional key modifiers.
    Drag(MouseButton, u16, u16, KeyModifiers),

    /// Scrolled mouse wheel downwards (towards the user).
    ///
    /// Contains the scroll location (column, row), and additional key modifiers.
    ScrollDown(u16, u16, KeyModifiers),

    /// Scrolled mouse wheel upwards (away from the user).
    ///
    /// Contains the scroll location (column, row), and additional key modifiers.
    ScrollUp(u16, u16, KeyModifiers),
}

pub enum MouseButton {

    /// Left mouse button.
    Left,

    /// Right mouse button.
    Right,

    /// Middle mouse button.
    Middle,

    /// An mouse button was not supported by the backend.
    Unknown,
}

pub enum KeyCode {

    /// Backspace key.
    Backspace,

    /// Enter key.
    Enter,

    /// Left arrow key.
    Left,

    /// Right arrow key.
    Right,

    /// Up arrow key.
    Up,

    /// Down arrow key.
    Down,

    /// Home key.
    Home,

    /// End key.
    End,

    /// Page up key.
    PageUp,

    /// Page dow key.
    PageDown,

    /// Tab key.
    Tab,

    /// Shift + Tab key.
    BackTab,

    /// Delete key.
    Delete,

    /// Insert key.
    Insert,

    /// F key.
    ///
    /// `KeyEvent::F(1)` represents F1 key, etc.
    F(u8),

    /// A character.
    ///
    /// `KeyEvent::Char('c')` represents `c` character, etc.
    Char(char),

    /// Null.
    Null,

    /// Escape key.
    Esc,
}

pub enum Color {

    /// Resets the terminal color.
    Reset,

    /// Black color.
    Black,

    /// Dark grey color.
    DarkGrey,

    /// Light red color.
    Red,

    /// Dark red color.
    DarkRed,

    /// Light green color.
    Green,

    /// Dark green color.
    DarkGreen,

    /// Light yellow color.
    Yellow,

    /// Dark yellow color.
    DarkYellow,

    /// Light blue color.
    Blue,

    /// Dark blue color.
    DarkBlue,

    /// Light magenta color.
    Magenta,

    /// Dark magenta color.
    DarkMagenta,

    /// Light cyan color.
    Cyan,

    /// Dark cyan color.
    DarkCyan,

    /// White color.
    White,

    /// Grey color.
    Grey,

    /// An RGB color. See [RGB color model](https://en.wikipedia.org/wiki/RGB_color_model) for more info.
    ///
    /// Most UNIX terminals and Windows 10 supported only.
    /// See [Platform-specific notes](enum.Color.html#platform-specific-notes) for more info.
    Rgb(u8, u8, u8),

    /// An ANSI color. See [256 colors - cheat sheet](https://jonasjacek.github.io/colors/) for more info.
    ///
    /// Most UNIX terminals and Windows 10 supported only.
    /// See [Platform-specific notes](enum.Color.html#platform-specific-notes) for more info.
    AnsiValue(u8),
}

pub enum Attribute {

    /// Resets all the attributes.
    Reset,

    /// Increases the text intensity.
    Bold,

    /// Decreases the text intensity.
    BoldOff,

    /// Emphasises the text.
    Italic,

    /// Turns off the `Italic` attribute.
    ItalicOff,

    /// Underlines the text.
    Underlined,

    /// Turns off the `Underlined` attribute.
    UnderlinedOff,

    /// Makes the text blinking (< 150 per minute).
    SlowBlink,

    /// Makes the text blinking (>= 150 per minute).
    RapidBlink,

    /// Turns off the text blinking (`SlowBlink` or `RapidBlink`).
    BlinkOff,

    /// Crosses the text.
    Crossed,

    /// Turns off the `CrossedOut` attribute.
    CrossedOff,

    /// Swaps foreground and background colors.
    Reversed,

    /// Turns off the `Reverse` attribute.
    ReversedOff,

    /// Hides the text (also known as hidden).
    Conceal,

    /// Turns off the `Hidden` attribute.
    ConcealOff,

    /// Sets the [Fraktur](https://en.wikipedia.org/wiki/Fraktur) typeface.
    ///
    /// Mostly used for [mathematical alphanumeric symbols](https://en.wikipedia.org/wiki/Mathematical_Alphanumeric_Symbols).
    Fraktur,

    /// Turns off the `Bold` attribute.
    NormalIntensity,

    /// Switches the text back to normal intensity (no bold, italic).
    BoldItalicOff,

    /// Makes the text framed.
    Framed,

    #[doc(hidden)]
    __Nonexhaustive,
}

pub enum Clear {

    /// All cells.
    All,

    /// All cells from the cursor position downwards.
    FromCursorDown,

    /// All cells from the cursor position upwards.
    FromCursorUp,

    /// All cells at the cursor row.
    CurrentLine,

    /// All cells from the cursor position until the new line.
    UntilNewLine,
}
